import React from 'react'

function ToDoLists(props) {
    return (
        <>

            <div className='todo-style'>
            <i class="fa-solid fa-xmark"></i>
                <i className='fa fa-items' aria-hidden="true"
                    onClick={() => {
                        props.onSelect(props.id)
                    }}
                />
                <li>{props.txt}</li>
            </div>

        </>
    )
}

export default ToDoLists
